export default (function(a,b,c,d){return {data:{bpWVSO8i15:{data:{id:1707,attributes:{imdbId:"tt0067280",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWJkMTMwMmEtMGYwZS00OTQxLThkZDYtNmIwZjFmOWIzZTI0XkEyXkFqcGdeQXVyNjgxNTAwNjQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.1\u002F10"}],item_lang:{data:{id:2370,attributes:{title:"Journey Back to Oz",plot:"During another twister, Dorothy is hit on the head by a gate and once again whisked away to the Land of Oz. But this time, on her way to the Emerald City, she discovers the witch Mombi's terrible plot to conquer Oz with an army of monster green elephants that's she's brewing up. She escapes with the help of Mombi's slave Pumpkinhead, and they try to warn King Scarecrow and her other friends that Mombi is coming, but she finds that they haven't quite changed as much as she thought. So it's up to her, Pumpkinhead, and the living carousel horse Woodenhead to find a way to stop Mombi's green elephants.",slug:"journey-back-to-oz"}}},books:{data:[{id:8770,attributes:{title:d,description:"Reproduction of the original: The Wonderful Wizard of Oz by L. Frank Baum",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QBWyDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2019-09-25",publisher:"BoD – Books on Demand",subtitle:a}},{id:8771,attributes:{title:d,description:"In the first of L. Frank Baum's time-honored Oz novels, country girl Dorothy Gale gets whisked away by a cyclone to the fantastical Land of Oz. Dropped into the midst of trouble when her farmhouse crushes a tyrannical sorceress, Dorothy incurs the wrath of the Wicked Witch of the West. Dorothy is desperate to return to her native Kansas, and, aided by the Good Witch of the North, she sets out for the Emerald City to get help from the legendary Wizard. On her way, she meets three unlikely allies who embody key human virtues—the Scarecrow, the Tin Woodman, and the Cowardly Lion.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=x5DQpIufcP4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1900-01-01",publisher:a,subtitle:a}},{id:8772,attributes:{title:"Crochet Stories: L. Frank Baum's The Wonderful Wizard of Oz",description:"Suitable for beginning to intermediate crocheters, this book features a retelling of the classic tale with 19 patterns for Baum's beloved characters and settings: Dorothy, Toto, Witch, Flying Monkey, more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6Ht3DgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Pat Olski"],firstBook:c,published:"2017-05-17",publisher:"Courier Dover Publications",subtitle:a}},{id:8773,attributes:{title:"L. Frank Baum's Wizard of Oz",description:"After a cyclone transports her to the land of Oz, Dorothy must seek out the great Wizard in order to return to Kansas.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=dYL5LwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Deborah Hautzig","Lyman Frank Baum","Robin Robinson"],firstBook:c,published:"2013-01-01",publisher:"Penguin Young Readers",subtitle:a}},{id:8774,attributes:{title:d,description:"The only edition of Baum's classic with full-color illustrations based on the original art now comes with two audio CDs! This lovely gift edition features an abridged text, accessible to even the youngest readers.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=kV7CAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2013-04-09",publisher:"Courier Corporation",subtitle:"Includes Read-and-Listen CDs"}}]}}},meta:{}}},prerenderedAt:1680940962939}}("","L. Frank Baum",null,"The Wonderful Wizard of Oz"))